import { JsonWebcamDump, Webcam, WebcamIdentifier } from '../shared';

export default class WebcamData {
  webcams: Webcam[];

  constructor() {
    this.webcams = WebcamData.PLACEHOLDER_DATA;
  }

  update(json: JsonWebcamDump): WebcamData {
    this.webcams = [
      ...this.webcams.filter((webcam) => Object.keys(json)[0] !== webcam.identifier),
      WebcamData.deserialize(json),
    ].sort((a: Webcam, b: Webcam) => (a.identifier > b.identifier ? 1 : b.identifier > a.identifier ? -1 : 0));

    return this;
  }

  static deserialize(json: JsonWebcamDump): Webcam {
    return { identifier: Object.keys(json)[0] as WebcamIdentifier, image: Object.values(json)[0] };
  }

  private static readonly PLACEHOLDER_DATA: Webcam[] = [
    {
      identifier: 'cam0',
      image:
        ' data:image/jpeg;base64,',
    },
    {
      identifier: 'cam1',
      image:
        ' data:image/jpeg;base64,',
    },
  ];
}
